import React, {useState} from 'react'
import Alerta from '../componentes/alertas/Alerta';

const Proband = () => {
    const [err,setErr] = useState(false);
    const error = ()=>{
        setErr(true);
    }
  return (
    <>
    
    
    <Button variant="primary" onClick={error}>
        Launch static backdrop modal
      </Button> 
      <Alerta titulo='Error!!!' descripcion='Debe iniciar sesión o registrarse para poder realizar dicha acción' link='brianmunioz.com' boton='Ir al link'></Alerta>
    
    </> )
}

export default Proband
